In #Rstats and tidyselect NSE, these 2 are VERY different:
var_summary &lt;- function(data, var) {
  data %&gt;%
    summarise(max({{ var }}))
}

var_summary2 &lt;- function(data, var) {
  class(var)
  data %&gt;%
    summarise(max({{ var }}))
}
(Don't touch {{ }} stuff before using them).

Thanks to the alpha testers of {svgparser}who gave invaluable early feedback!

